@jackylk CARBON_TIMESTAMP_MILLIS is more precise in terms of time as compared to  CARBON_TIMESTAMP_DEFAULT_FORMAT and in the first place, the bug exists due to using CARBON_TIMESTAMP_DEFAULT_FORMAT because in that case, it doesn't consider the millisecond time.

Also, there were three formats defined for TIMESTAMP in CarbonCommonConstants 
1) String CARBON_TIMESTAMP_DEFAULT_FORMAT = "yyyy-MM-dd HH:mm:ss"; (It has maximum occurences in the project currently)
2) String CARBON_TIMESTAMP = "dd-MM-yyyy HH:mm:ss";
3) String CARBON_TIMESTAMP_MILLIS = "dd-MM-yyyy HH:mm:ss:SSS";

Do you want me to use one format at all places? If yes, please suggest me one format from the three available formats.
